import {Component, OnDestroy, OnInit} from '@angular/core';
import {V3BiBreadcrumbArray} from "../../models/V3BiBreadcrumbArray";
import {MessageService} from "../../genericServices/message.service";
import {StorageService} from "../../genericServices/storage.service";
import {BreadcrumbService} from "../../genericServices/breadcrumb.service";
import {ScreenComponent} from "../../genericComponents/screen/screen.component";

@Component({
  selector: 'app-home',
  standalone: true,
  imports: [ScreenComponent],
  templateUrl: './home.component.html',
  styleUrl: './home.component.css'
})
export class HomeComponent  implements OnInit, OnDestroy{

  breadcrumb!: V3BiBreadcrumbArray;
  logoState= "enabled-logged-in";
  sidebarState= "disabled";

  constructor (
    private messageService: MessageService,
    private breadcrumbService: BreadcrumbService,
    private storage : StorageService
  ) {}

  ngOnInit() {
    this.storage.initLanguages();
    this.breadcrumbService.clean();
    this.breadcrumbService.addCrumb('Home','/welcome');
    //console.log("BREADCRUMB - home: ", this.storage.getCrumb())

  }
  ngOnDestroy() {
    // this.storage.removeLastCrumb();
    //console.log("BREADCRUMB - home: ", this.storage.getCrumb())
  }

  backgroundImage = 'data:image/png;base64,';
}
